#include <vector>
#include <cstdlib>
#include <string>
#include <iostream>
#include <algorithm>
using namespace std;
class solution {
public:
	void construct_sa(const string& S, long long *rank, long long *sa) {
		long long n = S.length();
		for (long long i = 0; i <= n; ++i) {
			sa[i] = i;
			rank[i] = i < n ? S[i] : -1;
		}
	
		long long k = 1;
		long long *tmp = (long long *) malloc((n + 1) * sizeof(long long));
		auto compare_sa = [=](long long i, long long j) -> bool {
			if (rank[i] != rank[j]) return rank[i] < rank[j];
			else {
				long long ri = i + k <= n ? rank[i + k] : -1;
				long long rj = j + k <= n ? rank[j + k] : -1;
				return ri < rj;
			}
		};

		for (; k <= n; k = k * 2) {
			cout << k << endl;
			sort(sa, sa + n + 1, compare_sa);
			tmp[sa[0]] = 0;
			for (long long i = 1; i <= n; ++i) {
				tmp[sa[i]] = tmp[sa[i - 1]] + (compare_sa(sa[i - 1], sa[i]) ? 1 : 0);
			}
			for (long long i = 0; i <= n; ++i) {
				rank[i] = tmp[i];
			}
		}
		//free(tmp);
	}

	void construct_lcp(const string& S, long long *rank, long long *sa, long long *lcp) {
		long long n = S.length();
		long i = 0;
		long h = 0;
		lcp[0] = 0;
		for (; i < n; ++i) {
			long long j = sa[rank[i] - 1];
			if (h > 0) h--;
			for (; j + h < n && i + h < n; h++) {
				if (S[j + h] != S[i + h]) break;
			}
			lcp[rank[i]] = h;
		}
	}

	string longest_duplicate_string(string S) {
		long long s_len = S.length();
		cout << "s len: " << s_len << endl;
		long long *rank = (long long *) malloc((s_len + 1) * sizeof(long long));
		long long *sa = (long long *) malloc((s_len + 1) * sizeof(long long));
		long long *lcp = (long long *) malloc((s_len + 1)* sizeof(long long));
		construct_sa(S, rank, sa);
		construct_lcp(S, rank, sa, lcp);

		int l = 0;
		long long idx = 0;
		for (long long i = 1; i <= s_len; ++i) {
			if (l < lcp[i]) {
				l = lcp[i];
				idx = sa[i];
			}
		}
		cout << "l: " << l << " idx: " << idx << endl;
		return S.substr(idx, l);
	}
};

int main() {
	solution s = solution();
	cout << "result: " << s.longest_duplicate_string("") << endl;
	return 0;
}
